firebase.auth().onAuthStateChanged((user) => {
  if (user) {
    store.dispatch(login(user.uid));
    // renderApp();

    setTimeout(() => {
      renderApp();
    }, 2300)
    if (history.location.pathname === '/') {
      history.push('/cat2papers');
    }
  } else {
    store.dispatch(logout());
    // renderApp();
    setTimeout(() => {
      renderApp();
    }, 2300)
    history.push('/');
  }
});
